import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell, faCommentDots, faUser } from '@fortawesome/free-solid-svg-icons';


const Head = () => {


    const [visible, setVisible] = useState(true);
    const [lastScrollY, setLastScrollY] = useState(0);
    // const [toggleActive, setToggleActive] = useState(false); // 토글 상태 추가

      //로컬 스토리지에서 초기값 가져오기
  const [toggleActive, setToggleActive] = useState(() => {
    // 로컬 스토리지에서 초기값 가져오기
    const storedToggleState = localStorage.getItem('toggleActive');
    return storedToggleState !== null ? JSON.parse(storedToggleState) : false;
  });


    const handleScroll = () => {
      if (typeof window !== 'undefined') {
        const currentScrollY = window.scrollY;
        setVisible(lastScrollY > currentScrollY || currentScrollY < 10);
        setLastScrollY(currentScrollY);
      }
    };

    useEffect(() => {
      window.addEventListener('scroll', handleScroll);
      return () => {
        window.removeEventListener('scroll', handleScroll);
      };
    }, [lastScrollY]);

    // const handleToggleChange = () => {
    //   setToggleActive(!toggleActive); // 토글 상태 변경
    // };

      const handleToggleChange = () => {
    setToggleActive((prev) => !prev);
  };   // 이전 상태 기반



  return (
    <HeadWrapper visible={visible}>
    <Logo onClick={() => (window.location.href = "/")}>
      <span>iTeaMoa</span>
    </Logo>

    <ToggleContainer>
      <ToggleLabel active={toggleActive}>STUDY</ToggleLabel>
      <ToggleSwitch type="checkbox" checked={toggleActive} onChange={handleToggleChange} />
      <ToggleLabel active={!toggleActive}>PROJECT</ToggleLabel>
    </ToggleContainer>


    <UserActions>
        <UserIcon  className="bell" > <FontAwesomeIcon icon={faBell} size="15px" /></UserIcon>
        <UserIcon className="comment">     <FontAwesomeIcon icon={faCommentDots} size="15px" /></UserIcon>
        <UserIcon  className="user" >  <FontAwesomeIcon icon={faUser} size="15px" /></UserIcon>
        <LogoutButton>   로그아웃</LogoutButton>
    </UserActions>
  </HeadWrapper>
  )
}

export default Head;


const HeadWrapper = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  height: 20%;
  background-color: #ffffff;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 0 36px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  z-index: 3;
  transition: transform 0.5s ease;
  transform: translateY(${props => (props.visible ? '0' : '-100%')});
`;


const Logo = styled.div`
  position: absolute; 
  top: 40%; 
  cursor: pointer;
  font-size: 40px;
  color: #0080ff; 
`;

const ToggleContainer = styled.div`
  display: flex;
  align-items: center;
  position: absolute;
  top: 70%;
  cursor: pointer;
  font-size: 24px;
`;

const ToggleLabel = styled.label`
  margin: 0 10px;
  font-size: 16px;
  font-weight: bold;
  color: ${props => (props.active ? '#aaa' : '#0080ff')}; // 활성화 여부에 따라 색상 변경
`;

const ToggleSwitch = styled.input`
  appearance: none;
  width: 50px;
  height: 30px;
  background: #ccc; 
  border-radius: 30px; 
  position: relative;
  cursor: pointer;
  outline: none;

  &:checked {
    background: #62B9EC; 
  }

  &:checked::before {
    transform: translateX(24px); 
  }

  &::before {
    content: '';
    position: absolute;
    width: 26px; 
    height: 26px; 
    top: 7%;
    border-radius: 50%; 
    background: white; 
    transition: transform 0.2s; 
  }
`;



const UserActions = styled.div`
  position: absolute;
  top: 20%;
  right: 5%;
  display: flex;
  align-items: center;
  color: #0080ff;
`;



const LogoutButton = styled.div`
  border: 1px none #0080ff;
  background-color: #3563E9;  
  margin: 0 10px;
  padding: 8px 16px;
  border-radius: 5px;
  font-size: 16px;
  color: white;
  cursor: pointer;

  &:hover {
    color: #0080ff;
  }
`;


// const UserIcon = styled.div`
//   margin: 0 10px;
//   font-size: 25px;
//   cursor: pointer;
// `;


const UserIcon = styled.div`
  margin: 0 10px;
  font-size: 25px;
  cursor: pointer;

  /* 각 아이콘의 색상 설정 */
  &.bell {
    color: grey; /* 알림 아이콘 색상 */
  }

  &.comment {
    color: grey; /* 채팅 아이콘 색상 */
  }

  &.user {
    color: grey; /* 사용자 아이콘 색상 */
  }
`;
